import React from 'react';

class PopUp extends React.Component {
    render() {
        return (
            <div className='popup'>
                <div className='popup_inner'>
                    <h1>Do you want to Save the Playlist and Start a new one?</h1>
                    <button onClick="#">Save and Delete</button>
                    <button onClick="#">Just Save</button>    
                </div>
            </div>
        )
    }
}

export default PopUp;
